import React from 'react';
import '../../App.css';

export default function ContactUs() {
  return (
    <>
      <h1 id = "contact-title"> </h1>
      <p id="contact-description">Please feel free to contact us with any questions or concerns you may have.</p>
      <p class="contact-info-head">Email: <p class="contact-info"> info@theggtennisacademy.com</p></p>

    </>


  );
}
